import React, { PureComponent } from 'react';
import ResponsiveContainer from "react-responsive-widget";
import './App.css';
import {
    AreaChart, Area, XAxis, YAxis, CartesianGrid, Tooltip
} from 'recharts';

const data = [
    {name: 'Page A', uv: 3000, pv: 2400, amt: 2400},
    {name: 'Page B', uv: 3000, pv: 1398, amt: 2210},
    {name: 'Page C', uv: 2500, pv: 9800, amt: 2290},
    {name: 'Page D', uv: 2500, pv: 3908, amt: 2000},
    {name: 'Page E', uv: 2500, pv: 4800, amt: 2181},
    {name: 'Page F', uv: 3490, pv: 3800, amt: 2500},
    {name: 'Page G', uv: 3490, pv: 4300, amt: 2100},
];
const cardinal = d3.curveCardinal.tension(0.2);


export default class Ventes2 extends PureComponent {
  static jsfiddleUrl = 'https://jsfiddle.net/3mw50Lc9/1117/';

  render() {
    return (
    	<ScatterChart width={400} height={400} margin={{top: 20, right: 20, bottom: 20, left: 20}}>
      	<XAxis type="number" dataKey={'x'} name='stature' unit='cm'/>
      	<YAxis type="number" dataKey={'y'} name='weight' unit='kg'/>
        <ZAxis dataKey={'z'} range={[60, 400]} name='score' unit='km'/>
        <CartesianGrid />
      	<Tooltip cursor={{strokeDasharray: '3 3'}}/>
        <Legend />
        <Legend />
      	<Scatter name='A school' data={data01} fill='#8884d8' shape="star"/>
        <Scatter name='B school' data={data02} fill='#82ca9d' shape="triangle"/>
      </ScatterChart>
    );
  }
}
